import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import 'antd/dist/antd.css';
import { Provider } from 'mobx-react';
import stores from "./store/index"

ReactDOM.render(
   <Provider {...stores}>
     <App />
   </Provider>,
  document.getElementById('root')
);
